import './App.css';

import { BrowserRouter, Router, Route } from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <div className="App">
        <div className='content'>
          <Switch>
            <Route path='/'><Home /></Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
